import React, { useState, useEffect, useRef } from "react";
import axios from "axios";
import "./insurance_bot.css";

const InsuranceBot = () => {
  const [messages, setMessages] = useState([
    { sender: "bot", text: "\ud83d\udc4b Welcome! How can I assist you with insurance or healthcare plans today?" }
  ]);
  const [input, setInput] = useState("");
  const [memory, setMemory] = useState([]);
  const [listening, setListening] = useState(false);
  const messagesEndRef = useRef(null);
  const recognitionRef = useRef(null);

  useEffect(() => {
    scrollToBottom();
    if ("webkitSpeechRecognition" in window) {
      const SpeechRecognition = window.webkitSpeechRecognition;
      recognitionRef.current = new SpeechRecognition();
      recognitionRef.current.continuous = false;
      recognitionRef.current.interimResults = false;
      recognitionRef.current.lang = "en-US";

      recognitionRef.current.onresult = (event) => {
        const transcript = event.results[0][0].transcript;
        setInput(transcript);
      };

      recognitionRef.current.onerror = (event) => {
        console.error("Speech Recognition Error:", event.error);
      };
    }
  }, []);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  const handleSend = async () => {
    if (input.trim() === "") return;

    const userMessage = { sender: "user", text: input };
    setMessages((prev) => [...prev, userMessage]);
    setMemory((prev) => [...prev, input]);
    setInput("");

    try {
      const response = await axios.post("http://localhost:8000/chat", { message: input });
      const botReply = response.data.response;
      const formattedReply = formatBotResponse(botReply);
      setMessages((prev) => [...prev, { sender: "bot", text: formattedReply }]);
    } catch (error) {
      console.error("Error communicating with backend:", error);
      setMessages((prev) => [...prev, { sender: "bot", text: "\u26a0\ufe0f Sorry, something went wrong. Please try again later." }]);
    }
  };

  const formatBotResponse = (text) => {
    if (typeof text !== "string") return "";

    return text.replace(/\[(.*?)\]\((.*?)\)/g, (match, name, link) => {
      return `<a href="${link}" target="_blank" rel="noopener noreferrer" style="font-weight:bold;text-decoration:underline;">${name}</a>`;
    });
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") {
      handleSend();
    }
  };

  const toggleListening = () => {
    if (listening) {
      recognitionRef.current.stop();
      setListening(false);
    } else {
      recognitionRef.current.start();
      setListening(true);
    }
  };

  return (
    <div className="full-container">
      <div className="memory-sidebar">
        <h2>\ud83e\uddd0 Memory</h2>
        {memory.map((item, idx) => (
          <div key={idx} className="memory-item">{item.slice(0, 20)}...</div>
        ))}
      </div>

      <div className="chat-container">
        <div className="chat-header">\ud83e\uddd1\u200d\ud83d\udcbb Health Insurance Assistant</div>

        <div className="chat-messages">
          {messages.map((msg, idx) => (
            <div
              key={idx}
              className={`message ${msg.sender}`}
              dangerouslySetInnerHTML={{ __html: msg.text }}
            ></div>
          ))}
          <div ref={messagesEndRef} />
        </div>

        <div className="chat-input">
          <input
            type="text"
            placeholder="Type your message..."
            value={input}
            onChange={(e) => setInput(e.target.value)}
            onKeyDown={handleKeyPress}
          />
          <button className="send-button" onClick={handleSend}>Send</button>
          <button
            className={`mic-button ${listening ? "listening" : ""}`}
            onClick={toggleListening}
          >
            <span role="img" aria-label="mic">\ud83c\udfa4</span>
          </button>
        </div>
      </div>
    </div>
  );
};

export default InsuranceBot;
